                        <div class=\"heading_s1\">
                            <h3>Créer un compte</h3>
                        </div>
                        <div class=\"message-flash\">
                                 {% for flashError in app.flashes('verify_email_error') %}
                                    <div class=\"alert alert-danger\" role=\"alert\">{{ flashError }}</div>
                                 {% endfor %}
                        </div>

                        {{ form_start(registrationForm) }}
                            <div class=\"form-group\">
                                {{ form_row(registrationForm.username) }}
                            </div>
                            <div class=\"form-row\">
                                 <div class=\"col-md-6\">{{ form_row(registrationForm.firstname) }}</div>
                                 <div class=\"col-md-6\">{{ form_row(registrationForm.lastname) }}</div>

                            </div>
                            <div class=\"form-group\">
                                {{ form_row(registrationForm.email) }}
                            </div>
                            <div class=\"form-group\">
                               {{ form_row(registrationForm.plainPassword) }}
                            </div>

                            <div class=\"login_footer form-group\">
                                 {{ form_row(registrationForm.agreeTerms) }}
                             
                              <br><a href=\"{{path('cgu_conditions')}}\" target=\"_blank\">Lire les conditions</a>
                            </div>
                            <div class=\"form-group\">
                                <button type=\"submit\" class=\"btn btn-fill-out btn-block\" name=\"register\">S'inscrire</button>
                            </div>
